INSERT INTO `movie` VALUES ('mov0001','47 Meters Down: Uncaged',90,'2019-08-23','action','Liburan empat gadis untuk menyelam ke sebuah kota bawah air yang hancur berubah menjadi tragedi.Nyawa mereka terancam saat hiu ganas berada disekitar mereka. Kini keempatnya berusaha menyelamatkan diri dari ganasnya gigi tajam hiu besar.',_binary 'pictures/movies/mov0001.jpg'),('mov0002','Angel Has Fallen',121,'2019-08-21','action','Pasca percobaan pembunuhan Presiden AS. Agen rahasia Mike Banning (Gerard Butler) kini menjadi tersangka utama. Tidak terima, Mike kabur dan berusaha mengungkap pihak yang telah menjebaknya.',_binary 'pictures/movies/mov0002.jpg'),('mov0003','ANNA',118,'2019-06-22','action','Di balik keanggunan Anna Poliatova (Sasha Luss) terdapat sebuah rahasia. Model cantik ini adalah senjata yang sangat mematikan.Kemampuannya membunuh di lapangan menjadikan Anna salah satu agen rahasia yang paling ditakuti.',_binary 'pictures/movies/mov0003.jpg'),('mov0004','Bumi Manusia',181,'2019-08-15','action','Ini adalah kisah dua anak manusia yang meramu cinta di atas pentas pergelutan tanah kolonial awal abad 20.Inilah kisah Minke dan Annelies. Cinta yang hadir di hati Minke untuk Annelies, membuatnya mengalami pergulatan batin tak berkesudahan. Dia, pemuda pribumi, Jawa totok. Sementara Annelies, gadis Indo Belanda anak seorang Nyai.Bapak Minke yang baru saja diangkat jadi Bupati, tak pernah setuju Minke dekat dengan keluarga Nyai, sebab posisi Nyai di masa itu dianggap sama rendah dengan binatang peliharaan.Namun Nyai yang satu ini, Nyai Ontosoroh, ibunda Annelies, berbeda. Minke mengagumi segala pemikiran dan perjuangannya melawan keangkuhan hegemoni bangsa kolonial.Bagi Minke, Nyai Ontosoroh adalah cerminan modernisasi yang kala itu sedang memulai geliatnya. Ketika keangkuhan hukum kolonial mencoba merenggut paksa Annelies dari sisi Minke, Nyai Ontosoroh pula yang meletupkan semangat agar Minke terus maju dan memekikkan satu kata, \"Lawan!\" ',_binary 'pictures/movies/mov0004.jpg'),('mov0005','Once Upon A Time In Hollywood',160,'2019-08-24','comedy','Mengambil latar Los Angeles tahun 1969, Once Upon a Time in Hollywood akan berkisah tentang Rick Dalton (Leonardo DiCaprio), seorang bintang televisi yang pernah berjaya di masanya. Dengan berkembangnya industri layar lebar hollywood, Rick dan pemeran penggantinya Cliff Booth (Brad Pitt) memutuskan bekerja sama untuk mengejar karir di industri film.',_binary 'pictures/movies/mov0005.jpg'),('mov0006','Ready Or Not',94,'2019-08-24','action','Ready or Not adalah kisah seorang pengantin muda (Samara Weaving) ketika ia bergabung dengan keluarga besar suami barunya (Mark O\'Brien) yang kaya dan eksentrik (Adam Brody, Henry Czerny, Andie MacDowell) dalam tradisi keluarga yang berubah menjadi permainan mematikan dengan semua orang berjuang untuk bertahan hidup.',_binary 'pictures/movies/mov0006.jpg'),('mov0007','Gundala',123,'2019-08-29','action','Sancaka hidup di jalanan sejak ditinggal ayah dan ibunya. Menghadapi hidup yang keras, Sancaka belajar untuk bertahan hidup dengan tidak peduli dengan orang lain dan hanya mencoba untuk mendapatkan tempat yang aman bagi dirinya sendiri. Ketika situasi kota semakin tidak aman dan ketidakadilan merajalela di seluruh negeri, Sancaka harus buat keputusan yang berat, tetap hidup di zona amannya, atau keluar sebagai Gundala untuk membela orang-orang yang ditindas.',_binary 'pictures/movies/mov0007.jpg'),('mov0008','Twivortiare',103,'2019-08-29','action','Pertama mereka bertemu, langsung jatuh cinta. Dalam hitungan bulan, mereka menikah. Setelah dua tahun, setelah lelah dengan semua konflik dan pertengkaran yang tak berujung, akhirnya, sang Dokter Bedah yang super sibuk, Beno Wicaksono (REZA RAHARDIAN), dan Sang Bankir sukses, Alexandra Rhea (RAIHAANUN) memutuskan untuk bercerai.Sahabat Alex, Wina (ANGGIKA BOLSTERI), menyebutnya sebagai perceraian yang tak pernah serius berpisah, karena tautan berbagai peristiwa senantiasa mempertemukan mereka. Sekali pun ada laki-laki lain, Denny (DENNY SUMARGO) yang berusaha mengisi hati Alexandra, tapi tetap saja, kuatnya rasa cinta yang dipaksa untuk mati, malah makin bersemi. Mereka pun bersatu lagi. Pernikahan kedua pun terjadi.Kali ini Beno dan Alex berjanji, akan menjalani pernikahan ini dengan sikap lebih dewasa, saling mengerti dan mau mengalah. Mereka yakin, mereka bisa, karena masih saling cinta. Tapi apakah benar, cinta saja cukup? atau yang mereka rasakan itu... bukanlah cinta?',_binary 'pictures/movies/mov0008.jpg'),('mov0009','IT Chapter Two',168,'2019-09-04','action','Seri kedua akan melanjutkan kisah para anggota Losers Club.Dua puluh tujuh tahun setelah pertemuan pertama mereka dengan Pennywise yang menakutkan, Losers Club telah dewasa dan berpisah.Sampai sebuah panggilan telepon membawa Losers Club kembali untuk bertemu hantu kelam dari masa lalu mereka.',_binary 'pictures/movies/mov0009.jpg'),('mov0010','Chasing The Dragon II: Wild Wild Bunch',101,'2019-09-06','drama','Chasing the Dragon II: Wild Wild Bunch diangkat dari kejadian nyata yang pernah terjadi di Hong Kong pada 1990-an. Logan (Tony Leung Ka Fai) adalah kepala geng yang melakukan bisnis perdagangan manusia.Untuk menangkap ketua geng, kepolisian Hong Kong memutuskan untuk mengirim Sky (Louis Koo), agen rahasia yang misinya adalah untuk menyusup, menyelamatkan sandera dan menangkap seluruh kelompok Logan dan membawa mereka ke pengadilan.',_binary 'pictures/movies/mov0010.jpg'),('mov0011','CHHICHHORE',143,'2019-09-06','drama','Chhichhore akan membawa kisah penuh kegembiraan dan kesenangan yang terjadi di sebuah asrama kampus. Dunia di mana seseorang bertemu dengan karakter baru yang menarik, berbagi waktu bersama dan berakhir jadi teman sejati seumur hidup.Anni (Sushant Singh Rajput) Maya (Shraddha Kapoor) Sexa (Varun Sharma), Derek (Tahir Raj Bhasin), Mummy (Tushar Pandey), Acid (Naveen Polishetty) dan Bevda (Saharsh Shukla) adalah karakter yang bertemu di kampus dan menjadi sahabat. Bersama-sama, kelompok ini akan menjalani masa-masa indah, senang dan sedih. Saat mereka berpisah, kelompok ini akhirnya bertemu kembali dengan cara yang tidak pernah mereka pikirkan sebelumnya.',_binary 'pictures/movies/mov0011.jpg'),('mov0012','Warkop DKI Reborn',103,'2019-09-12','drama','Warkop DKI - Dono, Kasino, Indro kali ini mendapat tugas sebagai agen polisi rahasia. Mereka dibawah komando Komandan Cok, yang kehilangan tangan kanannya, Karman, saat mensinyalir adanya money laundry di dunia perfilman Indonesia. Tepatnya di sebuah PH yang dimiliki Amir Muka. Warkop DKI akhirnya bisa masuk dalam dunia film dan terlibat dalam sebuah pembuatan film komedi berpasangan dengan artis sinetron yang hijrah ke dunia film, Inka.Saat party, Warkop DKI yang sedang menyelidiki malah membuat Inka terjebak bersama mereka di sebuah ruangan. Warkop DKI dan Inka jatuh pingsan. Saat terbangun, Warkop DKI kaget karena berada di padang pasir! Tapi Inka lenyap! Pencarian Warkop DKI mencari jejak Inka, malah menyeret mereka dalam petualangan seru di padang pasir...',_binary 'pictures/movies/mov0012.jpg'),('mov0013','Lorong',93,'2019-09-12','drama','Terbangun pasca melahirkan, MAYANG (PRISIA NASUTION) mendapatkan kabar tidak seperti yang ia harapkan dari REZA (WINKY WIRYAWAN) sang suami, bahwa bayi pertama mereka telah meninggal dunia. Tapi kerelaan Mayang sebagai seorang ibu tidak begitu saja. Mayang mencari bayinya yang semua orang di rumah sakit yakin bahwa dirinya hanya berhalusinasi.Dia lantas menghubungi pihak kepolisian untuk mencari titik terang kasus janggal ini. Usaha Mayang menemui jalan buntu setelah dr. VERA (NOVA ELIZA) yang membantunya melahirkan, berhasil memberikan bukti berupa dokumen kematian bayinya, lengkap dengan beberapa foto kejadian. Di tengah keputusasaan, Mayang yang memilih tidak menyerah akhirnya mulai dianggap gila oleh sebagian orang di rumah sakit, termasuk suaminya sendiri. Hal ini ditambah dengan Mayang yang merasa terus diikuti roh penasaran. Apa yang sebenarnya terjadi? Dan siapakah yang benar, Mayang atau pihak rumah sakit dan Reza?',_binary 'pictures/movies/mov0013.jpg'),('mov0014','BOO!',88,'2018-10-12','drama','Berawal dari sebuah lelucon, sebuah keluarga mendapat teror mengerikan dari iblis yang datang mengancam mereka. Nyawa satu keluarga terancam karena mereka mengabaikan peringatan. Sang ayah yang tidak percaya dengan lelucon itu akhirnya menyadari ada kekuatan jahat datang dan meneror keluarganya.',_binary 'pictures/movies/mov0014.jpg'),('mov0015','Rambo: Last Blood',99,'2019-09-18','comedy','John Rambo (Sylvester Stallone) harus menghadapi masa lalunya dan kembali mengeluarkan keterampilan tempurnya untuk membalas dendam dalam misi terakhir yang sangat berbahaya.',_binary 'pictures/movies/mov0015.jpg'),('mov0017','Danur 3: Sunyaruri',90,'2019-09-26','drama','Setelah bersahabat dengan hantu-hantu kecilnya selama bertahun-tahun, Risa (Prilly Latuconsina) yang semakin dewasa mulai merasa bahwa dirinya harus memiliki kehidupan normal seperti perempuan lainnya. Apalagi sekarang Risa sudah memiliki pacar bernama Dimas (Rizky Nazar), yang bekerja sebagai penyiar radio. Risa bahkan tidak menceritakan kepada Dimas tentang kemampuannya melihat hantu, dan kenyataan bahwa dia memiliki 5 sahabat kecil yang bukan manusia. Persahabatan Risa dan Peter CS menjadi goyah, setelah Risa merasa Peter CS mulai mengusili Dimas.',_binary 'pictures/movies/mov0017.jpg'),('mov0018','One Piece: Stampede',101,'2019-09-18','drama','mereka diundang ke acara besar yang dikenal sebagai Pirates expo! Semua bajak laut terhebat berkumpul di pameran bajak laut,tiba-tiba angkatan laut ikut campur dalam kegiatan tersebut, Sebenarnya ada konspirasi apakah dibalik acara tersebut? ',_binary 'pictures/movies/mov0018.jpg'),('mov0019','Tazza: One Eyed Jack',138,'2019-09-27','drama','Do Il-Chool (Park Jung-Min) memiliki bakat untuk bermain poker. Ayahnya adalah seorang penjudi dan satu telinganya dipotong setelah dia ketahuan curang. Il-Chool bertemu penjudi misterius Aekku (Ryoo Seung-Bum) dan terlibat dalam dunia judi utama. Dibantu oleh Kkachi (Lee Kwang Soo) yang lihai manipulasi mereka bergelut dalam action menegangkan dalam dunia perjudian',_binary 'pictures/movies/mov0019.jpg'),('mov0020','Good Boys',90,'2019-09-21','action','Tiga anak laki-laki kelas 6 Pergi dari sekolah dan memulai petualangan seru mereka membawa obat-obatan yang dicuri secara tidak sengaja, diburu oleh gadis-gadis remaja, dan mereka mencoba pulang ke rumah tepat waktu untuk pesta yang sudah lama dinanti-nantikan.',_binary 'pictures/movies/mov0020.jpg'),('mov0021','Horas Amang - Tiga Bulan Untuk Selamanya',109,'2019-09-26','action','sebuah keluarga dengan hubungan yang tidak harmonis. Seorang Ayah (Amang) dan ketiga anaknya yang tidak berbakti. Karena cinta yang besar kepada anak-anaknya maka sang Ayah (Amang) menggunakan cara yang tidak biasa untuk mengubah hidup mereka selamanya.',_binary 'pictures/movies/mov0021.jpg'),('mov0022','Hayya: The Power Of Love 2',95,'2019-09-19','action','Dihantui perasaan bersalah dan dosa di masala lalu, Rahmat(32th) seorang jurnalis yang sedang belajar memahami arti tentang cinta dan keimanan merasa perlu melakukan hal yang berbeda dalam proses hijrahnya. Rahmat pun akhirnya memutuskan untuk menjadi relawan kemanusiaan di perbatasan camp pengungsian. Saat bertugas menjadi relawan kemanusiaan dan jurnalis di daerah tersebut, ia pun bertemu sosok Haya(5th) gadis lugu yatim piatu korban konflik di palestina. Kehadiran Haya banyak membawa perubahan terhadap kehidupan Rahmat, hingga suatu ketika Rahmat harus kembali ke Indonesia karena harus menikah dengan Yasna, membuat Haya terluka. Hubungan Rahmat, Haya dan Yasna tiba-tiba berubah menjadi kompleks, lucu dan menegangkan.',_binary 'pictures/movies/mov0022.jpg'),('mov0023','Ne Zha',110,'2019-09-25','action','Nezha adalah mitologi Tiongkok yang sangat terkenal, sama halnya seperti mitologi Sun Wukong. Dalam mitologi ini, diceritakan bahwa ibunda Nezha, Lady Lin, melahirkan seorang manusIa berbentuk bola setelah mengandung selama 3 tahun 6 bulan, Ayahnya, Li Jing, menyangka bahwa istrinya telah melahirkan seorang iblis dan menyerang bola tersebut dengan pedangnya.Bola terbelah dan keluarlah Nezha, anak laki-laki yang dapat langsung berjalan dan berbicara. Na Zha disembah dalam suatu agama rakyat Tiongkok. Film ini dimulai dengan aura dari Surga dan Bumi bertemu dan terciptalah sebuah mutiara yang mempunyai kekuatan dahsyat. Yuanshi Tianzun (Dewa Surga) memisahkan mutiara tersebut ke dalam dua pil - Pil Spiritual dan Pil Iblis. Pil Spiritual akan menjelma menjadi seorang lelaki yang ditakdirkan untuk membawa dinasti Zhou baru. Sedangkan Pil Iblis akan melahirkan seorang iblis yang dapat menghancurkan dunia. Oleh karena itu Yuanshi Tianzun menciptakan sebuah mantera pemanggil petir yang akan menghancurkan Pil Iblis dalam 3 tahun',_binary 'pictures/movies/mov0023.jpg'),('mov0024','Ad Astra',123,'2019-01-10','action','Seorang astronot melakukan perjalanan ke tepi luar tata surya untuk menemukan ayahnya dan mengungkap misteri yang mengancam kelangsungan hidup planet kita. Dia mengungkap rahasia yang mengancam keberadaan manusia dan tempat kita',_binary 'pictures/movies/mov0024.jpg'),('mov0025','Weathering With You',112,'2019-08-19','comedy','seorang anak muda dari desa terpencil di Shikoku, yang meninggalkan rumah dan memutuskan untuk tinggal di Tokyo. Dalam perjalanannya, dia bertemu dengan Keisuke, seorang pria aneh yang menawarkan bantuan kepadanya. Merasa aneh dengan orang tersebut, Hodoka memutuskan untuk mencoba mencari peruntungan yang lain. Namun dia menghadapi kesulitan yang datang silih berganti dalam perjalannya. Setelah beberapa kali tidur di jalanan karena tidak ada orang lain yang bias dihubungi, Hodoka memutuskan untuk menghubungi Keisuke. Hodoka mendapatkan tawaran bekerja sebagai penulis majalah lokal milik Keisuke yang membahas supernatural dan hal hal aneh. Selama di Tokyo, Hodoka selalu diikuti cuaca aneh dimana hujan turun tiada henti. Saat menulis sebuah cerita, dia mendengar kisah pengendalian cuaca. Dia berusaha mencari kebenaran dari legenda urban di mana ada seorang gadis muda yang memiliki kekuatan untuk menghentikan hujan dan membuat langit menjadi cerah kembali. Pencariannya ini membuatnya bertemu dengan Hina Amano, seorang gadis yang memiliki kekuatan luar biasa yang dapat mengendalikan cuaca.',_binary 'pictures/movies/mov0025.jpg'),('mov0026','JUDUL FILM 26',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0026'),('mov0027','JUDUL FILM 27',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0027'),('mov0028','JUDUL FILM 28',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0028'),('mov0029','JUDUL FILM 29',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0029'),('mov0030','JUDUL FILM 30',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0030'),('mov0031','JUDUL FILM 31',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0031'),('mov0032','JUDUL FILM 32',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0032'),('mov0033','JUDUL FILM 33',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0033'),('mov0034','JUDUL FILM 34',120,'2019-09-30','comedy','SEBUAH FILM COMEDY',_binary 'pictures/movies/mov0034');
